        }

        data[keys.length-1].color='#7777ff';
        data[keys.length-1].area =true;
        return data;
    }

function tooltipContent(key, y, e, graph) {
            return '<h3>' + key + '</h3>' +'<p>' + y + '</p>' ;
        }

</script>
